$('#phoneNumber').blur(function(){$('#phoneNumber').removeClass();var phoneV=$('#phoneNumber').val();var phoneLngth=phoneV.length;if(/[^0-9]/.test(phoneV)){$('#phoneNumber').addClass('notValid');$('#spnPhoneStatus').css('color','red');$(this).next().text('Укажите правильный телефон');}else if(phoneLngth<=5){$('#phoneNumber').addClass('notValid');$('#spnPhoneStatus').css('color','red');$(this).next().text('Укажите правильный телефон');}});$(function(){var availableTags=["Проворный ткачик","ПРОФИ-СПОРТ","Проспект","Просто Чудо","Прокат Пони+",];$("#franchiseName").autocomplete({source:availableTags});});
